import React from 'react';
import styled from 'styled-components';

const ChattingInputBlock = styled.div`
  width: 100%;
  display: flex;
  flex: 1;
`;
const ChattingInputLeftBox = styled.div`
  background: gray;
  width: 80%;
  height: 100%;
`;
const ChattingInputRightBox = styled.div``;
const ChattingArea = styled.textarea`
  resize: none;
  height: 100%;
  border: none;
  background: pink;
`;

const ChattingInput = () => {
  return (
    <ChattingInputBlock>
      <ChattingInputLeftBox>
        <ChattingArea />
      </ChattingInputLeftBox>
      <ChattingInputRightBox></ChattingInputRightBox>
    </ChattingInputBlock>
  );
};

export default ChattingInput;
